import React, { useState } from 'react';
import logo from './logo.png';
import { AiOutlineMenu, AiOutlineMinus } from 'react-icons/ai';
import { Link } from 'react-router-dom';

const Header = () => {
  const [click, setClick] = useState(false);
  const handleClick = () => setClick(!click);

  const handleNavigate = (path) => {
    // Logic for navigation if needed
  };

  return (
    <div className="container">
      <div className="profile-details">
        {error && <p>Error: {error}</p>}
        {walletConnected ? (
          <div>
            <p>Wallet Connected Successfully</p>
            <p>Account Address: {accountAddress}</p>
            {/* Add additional wallet details here */}
            <button className="wallet-button" onClick={handleContractInteractions}>
              Interact with Contract
            </button>
          </div>
        ) : (
          <div>
            <p>Connect to Wallet</p>
            <button className="wallet-button" onClick={connectToWallet}>
              Connect
            </button>
          </div>
        )}
      </div>

      <div className="profile">
        <img src={profilePicture} alt="Profile" className="avatar" />
      </div>

      <div className="form">
        <h2>Sign Up For Insurance</h2>
        <input type="text" placeholder="Your xrd Domain" value={username} onChange={(e) => setUsername(e.target.value)} />
        <input type="number" placeholder="Premium Amount" value={premiumAmount} onChange={(e) => setPremiumAmount(e.target.value)} />
        <input type="number" placeholder="Payout Amount" value={payoutAmount} onChange={(e) => setPayoutAmount(e.target.value)} />
        <input type="number" placeholder="Risk Level" value={riskLevel} onChange={(e) => setRiskLevel(e.target.value)} />
        <button className="large-button" onClick={signUp}>
          Create Insurance
        </button>
      </div>

      {/* Claim Money Button */}
      <button className="large-button" onClick={claimMoney}>
        Claim Money
      </button>
      {claimStatus && <p>{claimStatus}</p>}

      {/* Stalk Input and Button */}
      <div className="stalk-section">
        <input type="text" placeholder="Enter ID to stalk" onChange={handleStalkInputChange} />
        <button className="large-button" onClick={() => stalk(stalkingInput)}>
          Stalk
        </button>
        {stalkingResult && <p>{stalkingResult}</p>}
      </div>
    </div>
  );
};

export default Profile;
